We can use the CYK algorithm on the CNF grammar.  Label the input positions 1–6 with the sets of nonterminals that produce each single terminal:

pos 1 = t3 ⇒ {NT35, NT12, NT26, NT74, NT77, NT80, NT22, NT54, NT96, NT68}  
pos 2 = t3 ⇒ same set  
pos 3 = t0 ⇒ {NT3, NT7, NT39, NT43, NT68, NT84, NT86, NT98, NT62, NT1}  
pos 4 = t4 ⇒ {NT21, NT22, NT34, NT52, NT54, NT64, NT66, NT74, NT82, NT36, NT96}  
pos 5 = t4 ⇒ same as pos 4  
pos 6 = t3 ⇒ same as pos 1

Then build up spans of length 2,3,…,6 by combining pairs via the binary productions.  One finds

spans of length 2:  
(1–2) = {NT3}  
(2–3) = {NT5}  
(3–4) = {NT70}  
(4–5) = {NT3}  
(5–6) = {NT3}

spans of length 3, 4, 5, and ultimately 6 all turn out empty (no nonterminal can cover those longer spans).  In particular the top cell span(1–6) is empty, so S never appears there.

Conclusion: the grammar does **not** generate the string.  
